import Book from "./Book";
import AddBook from "./AddBook";
import Auth from "./Auth";

function App() {
  return (
    <>
      <Routes>
        <Route path="/" element={<Signin />} />
        <Route path="/signup" element={<Signup />} />
        <Route path="/Addbook" element={<AddBook />} />

        <Route path="/book" element={<Book />} />
      </Routes>

